content.css:
p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
.loading-indicator {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background: rgba(255, 255, 255, 0.8);
  padding: 10px 20px;
  border-radius: 4px;
  font-size: 14px;
  z-index: 1000;
}
.cosmograph-visual {
  position: relative;
  width: 100%;
  height: 100%;
}
.cosmograph-visual .splash-screen {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background: radial-gradient(ellipse at bottom, #090A0F 0%, #000000 100%);
  display: flex;
  flex-direction: column;
  gap: 20px;
  justify-content: center;
  align-items: center;
  padding: 20px;
  text-align: center;
  overflow: hidden;
}
.cosmograph-visual .splash-screen:before {
  content: '';
  position: absolute;
  width: 200%;
  height: 200%;
  top: -50%;
  left: -50%;
  z-index: 0;
  background-image: radial-gradient(white, rgba(255, 255, 255, 0.2) 1px, transparent 2px), radial-gradient(white, rgba(255, 255, 255, 0.15) 1px, transparent 2px), radial-gradient(white, rgba(255, 255, 255, 0.1) 1px, transparent 2px), radial-gradient(rgba(255, 255, 255, 0.4), rgba(255, 255, 255, 0.1) 1px, transparent 2px);
  background-size: 350px 350px, 250px 250px, 150px 150px, 200px 200px;
  animation: twinkle 15s linear infinite;
  opacity: 0.7;
}
.cosmograph-visual .splash-screen .welcome-text,
.cosmograph-visual .splash-screen .subtext,
.cosmograph-visual .splash-screen .tutorial-text {
  position: relative;
  z-index: 1;
}
.cosmograph-visual .splash-screen .welcome-text {
  font-size: 1.8em;
  color: #ffffff;
  opacity: 0;
  animation: fadeIn 3.5s ease-in forwards;
}
.cosmograph-visual .splash-screen .subtext {
  cursor: pointer;
  font-size: 1.2em;
  color: #ffffff;
  opacity: 0;
  animation: fadeIn 3.5s ease-in forwards;
  animation-delay: 2s;
}
.cosmograph-visual .splash-screen .subtext:hover {
  text-decoration: underline;
}
.cosmograph-visual .splash-screen .tutorial-text {
  font-size: 1.6em;
  color: #ffffff;
  opacity: 0;
  animation: fadeIn 2.5s ease-in forwards;
}
.cosmograph-visual .splash-screen .tutorial-example {
  font-size: 1.1em;
  color: #ffffff;
  opacity: 0;
  animation: fadeIn 2.5s ease-in forwards;
  animation-delay: 1.5s;
  margin-top: 20px;
  line-height: 1.5;
  max-width: 500px;
}
.cosmograph-visual .splash-screen .next-arrow {
  position: relative;
  font-size: 1.4em;
  color: #ffffff;
  opacity: 0;
  animation: fadeIn 2s ease-in forwards;
  animation-delay: 3s;
  cursor: pointer;
  margin-top: 30px;
  transition: transform 0.3s ease;
  z-index: 1;
  letter-spacing: 0.1em;
}
.cosmograph-visual .splash-screen .next-arrow:hover {
  transform: scale(1.2);
}
.cosmograph-visual .splash-screen .tagline {
  font-size: 1.2em;
  color: #ffffff;
  opacity: 0;
  animation: fadeIn 3.5s ease-in forwards;
  animation-delay: 1s;
  margin-top: 10px;
}
@keyframes fadeIn {
  0% {
    opacity: 0;
  }
  20% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
@keyframes twinkle {
  from {
    transform: translateY(0);
  }
  to {
    transform: translateY(-100px);
  }
}
